import React, {Component} from "react"
import Airtable from "airtable";

const base = new Airtable({ apiKey: "keyHHrGcNLiewGh05" }).base(
    "appnnQqeeXZmvVJvB"
  );

export default class Conferences extends Component{
    constructor(props){
        super(props)
        this.state={employee:[]}
    }
    componentDidMount() {
        let name = this.props.name.match.params.name;
        let meeting=this.props.name.match.params.meeting;
        let a = `'${meeting}'`;
        base("Imported table")
          .select({
            view: "Grid view",
            filterByFormula: "AND({Participant Name}="+`'${name}'`+",{Meeting Code}="+`'${meeting}'`+")"
          })
          .eachPage((records, fetchNextPage) => {
            this.setState({ employee: records });
            fetchNextPage();
          });
      }
    render(){
